script: |
  super -f text -I q10335.spq | sort > q10335.out

inputs:
  - name: q10335.spq
    data: |
      SELECT DISTINCT + col2 / col2 * + col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 - col2 BETWEEN + ( + col2 ) + + + col0 AND + 18;
  - name: tab1

outputs:
  - name: q10335.out
    data: |
      59
      68
      96
